import React from 'react';

function Left_sb_option(props) {
  return (
    <div className='side__ber__option'>
      <div className='profile__name_icon'>
        <div>{props.Icon}</div>
        <p>{props.name}</p>
      </div>
    </div>
  );
}

export default Left_sb_option;
